        return '0'
    n = int(stdin)
    a = [int(x) for x in stdin.split()]
    k = 0
    k_arr = []
    while n > 0:
        if k == 0:
            for x in range(n):
                if a[x] <= a[x - 1]:
                    k += 1
                    k_arr.append(k)
                    break
            n -= 1
        else:
            for x in range(n):
                if a[x] <= a[x - 1]:
                    k += 1
                    k_arr.append(k)
                    break
            n -= 1
    max_k = max(k_arr)
    if k == max_k:
        return str(max_k)
    else:
        max_k_str = ''.join([str(x) for x in k_arr])
        if max_k_str == '2':
            return str(max_k)
        return str(max_k) + 'R' + max_k_str

