    '''
    Brute force approach.
    Find all numbers that add up to all the numbers from the input data.
    Find all numbers that add up to every other number from the input data.
    Find all numbers that add up to every fourth number from the input data.
    Find all numbers that add up to the last number from the input data.
    '''
