    # Store the input data in array
    a = list(map(int, stdin.strip().split()))

    # We need to find all numbers that add up to each other
    for i in range(1, n - 1):
        for j in range(i + 1, n - 1):
            if (a[i] + a[j]) == a[n - 1]:
                return str(a[i]) +'' + str(a[j])

    # Find numbers that add up to every other number
    for i in range(1, n - 2):
        for j in range(i + 1, n - 1):
            if (a[i] + a[j]) == a[i + 1]:
                return str(a[i]) +'' + str(a[j]) +'' + str(a[i + 1])

    # Find numbers that add up to every fourth number
    for i in range(1, n - 3):
        for j in range(i + 1, n - 2):
            if (a[i] + a[j]) == a[i + 2]:
                return str(a[i]) +'' + str(a[j]) +'' + str(a[i + 2])

    return str(a[n - 1])


